import React, { Component } from "react";
import Title from "./Title"
import FastAPIText from "../Data/FastAPIText"
import Carousel from "react-bootstrap/Carousel";

//homepage

class FastAPI extends React.Component{
    render(){
        return(
            <div>
                <Title text="Home"></Title>
                <div className="Body">
                    <div className="introduction">
                    <Carousel>
                <Carousel.Item className="carousel-item" id="software-skills">
                  <img className="image" src={csback} alt="First slide" />
                  <Carousel.Caption className="text-carousel">
                    {softwareSkills.map(skill => (
                      <div className="text-car">
                        <h4 className="left">{skill[0]}</h4>
                        <h4 className="right">{skill[1]}</h4>
                      </div>
                    ))}
                  </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item className="carousel-item" id="languages-skills">
                  <img className="image" src={woodbc} alt="First slide" />
                  <Carousel.Caption className="text-carousel">
                    {proSkills.map(skill => (
                      <div className="text-car">
                        <h4 className="left">{skill[0]}</h4>
                        <h4 className="right">{skill[1]}</h4>
                      </div>
                    ))}
                  </Carousel.Caption>
                </Carousel.Item>
              </Carousel>
                    </div>
                </div>
            </div>
        )
    }
}

export default FastAPI
